import React from 'react';
import { View } from 'react-native';
import AppNavigator from './components/AppNavigator';
import BottomNavigator from './components/bottom-nav-bar/BottomNavigator';

export default function App() {
  return (
    <View style={{ flex: 1 }}>
      <AppNavigator />
      <BottomNavigator />
    </View>
  );
}
